import React from 'react'

import cardData from 'cardData'

import img1 from "./img/1bus.jpg";

const Card = () => {
    return (
        <div className="card">
            <img src={img1} alt="ERROR"/>
            <p className="card_name">BUSINESS CARD</p>
        </div>
    )
}

export default Card;
